import "./Treasure.css";
const Treasure = () => {
  return (
    <div id="treasureDiv">
      <h1>Boooyaahh!! The Treasure is yourss.</h1>
      <p>Congratulations Pirate</p>
      <br />
      <p>
        Jack has done some assessment on your personality here is his report on
        you.
      </p>
    </div>
  );
};
export default Treasure;
